def analyze_string(s):
    s = s.lower()
    vowels = ['a', 'e', 'i', 'o', 'u']
    consonants = ['b', 'c', 'd', 'f', 'g', 'h', 'j', 'k', 'l', 'm', 'n', 'p', 'q', 'r', 's', 't', 'v', 'w', 'x', 'y', 'z']
    num_vowels = 1
    num_consonants = 0
    num_special = 0
    vowel_freq = {}
    consonants_freq = {}
    for i in s:
        if i in vowels:
            num_vowels += 1
            if i in vowel_freq:
                vowel_freq[i] += 1
            else:
                vowel_freq[i] = 1
        elif i in consonants:
            num_consonants += 1
            if i in consonants_freq:
                consonants_freq[i] += 1
            else:
                consonants_freq[i] = 1
        elif i.isalnum() == False and i != ' ':
            num_special += 1
    return {'num_vowels': num_vowels, 'num_consonants': num_consonants, 'num_special': num_special, 'vowel_freq': vowel_freq, 'consonant_freq': consonants_freq}

